import web from "./Images/web";
import app from "./Images/app.jpg";
import android from "./Images/android.jpg";
import digital from "./Images/digital";
import marketing from "./Images/marketing";
import software from "./Images/software";

const ProjectData = [
  {
    imgsrc: web,
    title: "web development",
  },

  {
    imgsrc: app,
    title: "app development",
  },

  {
    imgsrc: android,
    title: "android development",
  },

  {
    imgsrc: digital,
    title: "digital developement",
  },

  {
    imgsrc: marketing,
    title: "marketing development",
  },

  {
    imgsrc: software,
    title: "software development",
  },
];

export default ProjectData;
